import React from 'react';

const GameNav = () => {
  return (
    <div>
      <ul>
        <li>Hedelmäpelit</li>
        <li>Uutuudet</li>
        <li>Jackpotit</li>
        <li>Pöytäpelit</li>
      </ul>
    </div>
  );
};

export default GameNav;
